      <p>
      By choosing the Public option you are allowing anyone in the world to view your submission.   You may choose to apply one of several Creative Commons licenses to your submission, which are explained on the submission form and in the FAQ.  These licenses allow you to set your own terms of use for anyone accessing the submission.  You authorize Institution to distribute your content under the terms of that Creative Commons license and to allow users of Hyrax to do the same if your license choice permits that.

      If you do not choose a license, you grant to Institution the non-exclusive right to distribute your submission (including the metadata and abstract) worldwide, in any format or medium for non-commercial, research, educational, or related academic purposes only.  You also authorize Institution to allow users of the repository to distribute your submission (including the metadata and abstract) worldwide, in any format or medium for non-commercial, research, educational, or related academic purposes only. Institution will clearly identify your name(s) as the author(s) or owner(s) of the submission, and will not make any alteration, other than as allowed by this license, to your submission.
      </p>

      <h3>Visibility Level: <span class="label label-info">INSTITUTION</span></h3>

      <p>
      If you select the Institution access option, you have decided to restrict access only to users of Institution's network. Your deposit will not be accessible to colleagues or students at other universities or to members of the public. If you want your work to be accessible to the broader scholarly community, you should consider the regular Public option instead.  If you choose, you may also further limit access to specific individuals or groups of individuals at Institution.
